                  SUM(`infantsabove2m`) AS `infantsabove2m`, 
                  SUM(`infantsabove2mPOS`) AS `infantsabove2mpos`, 
                  AVG(`medage`) AS `medage`,
                  SUM(`rejected`) AS `rejected`     ";


     IF (from_month != 0 && from_month != '') THEN
      SET @QUERY = CONCAT(@QUERY, " FROM `site_summary` `is` ");
    ELSE
