CREATE DEFINER=`root`@`%` PROCEDURE `proc_get_vl_subcounty_details` (IN `filter_county` INT(11), IN `filter_year` INT(11), IN `from_month` INT(11), IN `to_year` INT(11), IN `to_month` INT(11))  BEGIN
