    SET @QUERY = CONCAT(@QUERY, " AND `subcounty` = '",C_id,"' AND (`year` = '",filter_year,"'  OR  `year` = '",to_year,"') GROUP BY `year`, `month` ORDER BY `year` ASC, `month` ");
    
